import {configureStore} from "@reduxjs/toolkit";
import languageReducer from "./languageSlice";
import loginReducer from "./loginSlice";
import nameReducer from "./clientSlice";
import surnameReducer from "./clientSlice";
import emailReducer from "./clientSlice";

const store = configureStore({
    reducer: {
        language: languageReducer,
        userStatus: loginReducer,
        userName: nameReducer,
        userSurname: surnameReducer,
        userEmail: emailReducer,
    },
});

export default store;
